import React from "react";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <nav>
      <div>
        <Link href="/">
          <h1>Blog live</h1>
        </Link>
      </div>
      <div>
        <Link href="/"></Link>
        <Link href="about">Sobre</Link>
        <Link href="contact">Contatos</Link>
      </div>
    </nav>
  );
}
